import {Link } from 'react-router-dom'
import {Text} from '@mantine/core'

interface NavbarSectionProps {
  title: string
  link: string

}

const NavbarSection = ({title, link}:NavbarSectionProps) =>
{
  return(
    <Link to={link} className="no-underline text-black cursor-pointer flex flex-row align-center">
        <Text className="px-4 hover:bg-gray-200 h-[40px]">
          {title}
        </Text>
    </Link>
  )
}

export default NavbarSection
